v8:item.v8:content:
Принимает значение: СЧФ | СЧФДОП | ДОП | СвРК | СвЗК, где: 
СЧФ - счет-фактура, применяемый при расчетах по налогу на добавленную стоимость;
СЧФДОП - счет-фактура, применяемый при расчетах по налогу на добавленную стоимость, и документ об отгрузке товаров (выполнении работ), передаче имущественных прав (документ об оказании услуг);
ДОП - документ об отгрузке товаров (выполнении работ), передаче имущественных прав (документ об оказании услуг);
СвРК – документ, включающий в себя сведения о факте реализации комиссионером (агентом, действующим от собственного имени), товаров комитента (принципала);
СвЗК – документ, включающий в себя сведения о факте закупки комиссионером (агентом, действующим от собственного имени) товара для комитента (принципала).
Под отгрузкой товаров понимается в том числе  передача (поставка, отпуск) товара (груза).

Для Функция = СЧФ:
1 - счет-фактура, выставляемый при реализации товаров (работ, услуг), передаче имущественных прав;
2 - счет-фактура, выставляемый при получении оплаты, частичной оплаты в счет предстоящих поставок товаров (выполнения работ, оказания услуг), передачи имущественных прав;
3 - счет-фактура, применяемый в случае реализации комиссионером (агентом, экспедитором, застройщиком или заказчиком, выполняющим функции застройщика) двум и более покупателям (приобретения у двух и более продавцов) товаров (работ, услуг), имущественных прав от своего имени.
Для Функция = СЧФДОП или Функция = ДОП:
4 - Товары переданы от Комитента (Принципала) Комиссионеру (Агенту, действующему от собственного имени) для дальнейшей реализации;
5 - Товары переданы от Комиссионера (Агента, действующего от собственного имени) Комитенту (Принципалу) при возврате товаров;
6 - Товары переданы от Комиссионера (Агента, действующего от собственного имени) Комитенту (Принципалу) при закупке товара;
7 - Товары переданы от Комитента (Принципала) Комиссионеру (Агенту, действующему от собственного имени) при возврате товаров;
8 - Возврат товара от Покупателя Продавцу.
